import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { fetchHelpAndFAQAData } from './HelpAndFAQSlice';

export const HelpAndFAQ = () => {
  const dispatch = useDispatch();
  const helpfaq = useSelector((state) => state.helpfaq);
  const isLoading = useSelector((state) => state.isLoading);
  const isError = useSelector((state) => state.helpfaq.isError);
  const errorMessage = useSelector((state) => state.helpfaq.errorMessage);

  useEffect(() => {
    dispatch(fetchHelpAndFAQAData());
  }, [dispatch]);

  return (
    <div>
      <h1>Help and FAQ</h1>
      {isLoading && <p>Loading...</p>}
      {isError && <p>Error: {errorMessage}</p>}
      <div>
        {helpfaq.map((category, index) => (
          <div key={index}>
            <h2>{category.name}</h2>
            <ul>
              {category.questions.map((question, qIndex) => (
                <li key={qIndex}>{question}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};
